import React from 'react';
import { Button } from 'semantic-ui-react';

const NavBar = ({ history, currentUser, logout, signUp }) => {
  const authLinks = (
    <div>
      <Button color='red' onClick={() => history.push('/search')}>
        Search
      </Button>
      {currentUser && (
        <Button as='icon' color='red' onClick={() => history.push('/profile')}>
          Profile
        </Button>
      )}
      {currentUser && (
        <Button color='red' onClick={logout}>
          Logout
        </Button>
      )}
    </div>
  );
  const guestLinks = (
    <div>
      <Button color='red' onClick={() => history.push('/login')}>
        Login
      </Button>

        <Button as='icon' color='red' onClick={() => history.push('/profile')}>
          Profile
        </Button>
)}
      {currentUser && (
        <Button color='red' onClick={logout}>
          Logout
        </Button>
      )}
    </div>
  )

  return <>{currentUser ? authLinks : guestLinks}</>;
};
export default NavBar;
